import React from "react";
import { NavLink } from "react-router-dom";
import {
  Button,
  Dropdown,
  Image,
  Menu,
  Input,
  Icon,
  Container,
  Divider
} from "semantic-ui-react";

function Navbar() {
  return (
    <div>
      <Menu inverted fixed="top" size="massive">
        <Container>
          <Image
            as={NavLink}
            to="/home"
            src="images/naxus12.PNG"
            size="small"
          />
          <Menu.Item>
            <Input
              size="large"
              className="icon"
              icon="search"
              placeholder="Searching?"
            />
          </Menu.Item>
          
          <Menu.Menu position="right">
          <Menu.Item>
            <Icon name="user outline" size="large" />
            <Dropdown item text="Account">
              <Dropdown.Menu>
                <Dropdown.Item>
                  <Button primary size="small" as={NavLink} to="/loginscreen">
                    Giriş Yap
                    <Icon name="sign in" />
                  </Button>
                </Dropdown.Item>
                <Dropdown.Item>
                  <Button primary size="small" as={NavLink} to="/signup">
                    Kayıt Ol <Icon name="signup" />
                  </Button>
                </Dropdown.Item>
              </Dropdown.Menu>
            </Dropdown>
          </Menu.Item>
          </Menu.Menu>

          <Menu.Item>
             <Button
              backgroundcolor="grey"
              inverted
              color="black"
              as={NavLink}
              to="/myfavorites"
            >
              <Icon name="heart outline" />
              Favorilerim
            </Button>
          </Menu.Item>
          <Menu.Item>
            <Button
              backgroundcolor="grey"
              inverted
              color="black"
              as={NavLink}
              to="/cart"
            >
              <Icon name="shopping cart" />
              Sepetim
            </Button>
          </Menu.Item>
        </Container>
      </Menu>
      <Divider />
      <Menu  >
        <Container>
          <Menu.Item>
            <Button>Anasayfa</Button>
          </Menu.Item>
          <Menu.Item name="messages" />
          <Menu.Menu position="right">
          </Menu.Menu>
        </Container>
      </Menu>
    </div>
  );
}
export default Navbar;

